import React from 'react';
import ReactDOM from 'react-dom';

const CarouselItems = [
    {
      "imgName" : "carousel-item active",
      "imgsrc" : "/images/Hike/img1.jpg",
      "imgalt" : "hk1",
      "caption" : "iuuadf",
      "href" : "#",
      "indicators" : {
                    "target" : "#hike",
                    "slideto" : "0",
                    "className" : "active"
      }
    },
    {
      "imgName" : "carousel-item",
      "imgsrc" : "/images/Hike/img2.jpg",
      "imgalt" : "hk2",
      "caption" : "jirkklsfh",
      "href" : "#",
      "indicators" : {
                    "target" : "#hike",
                    "slideto" : "1",
                    "className" : ""
      }
    },
    {
    "imgName" : "carousel-item",
    "imgsrc" : "/images/Hike/img3.jpg",
    "imgalt" : "hk3",
    "caption" : "jirkklsfh",
    "href" : "#",
    "indicators" : {
                  "target" : "#hike",
                  "slideto" : "2",
                  "className" : ""
    }
  }
]
export default CarouselItems;
